import {Container} from 'react-bootstrap';
import mainBanner from '../Banner/banner-images/mainBanner'
import './Banner.css'

function Banner(){
    return(
        <Container fluid>
            <Container className = "banner" style={{backgroundImage, mainBanner}}>
                Word
            </Container>
        </Container>
    )
}

export default Banner
